import PortfolioItem from "./PortfolioItem";

let portfolioContent = [
    {
        "image" : "<img src='assets/img/portfolio/style5/3.jpg' />",
        "title" : "We are here",
        "category" : "website design",
        "description" : "page-header d-flex align-items-center py-5 bg-img1",
        "reverse" : "no"
    },
    {
        "image" : "<img src='assets/img/portfolio/style5/3.jpg' />",
        "title" : "We are here",
        "category" : "website design",
        "description" : "page-header d-flex align-items-center py-5 bg-img1",
        "reverse" : "no"
    },
    {
        "image" : "<img src='assets/img/portfolio/style5/3.jpg' />",
        "title" : "We are here",
        "category" : "website design",
        "description" : "page-header d-flex align-items-center py-5 bg-img1",
        "reverse" : "no"
    },
];

const allitem = <PortfolioItem />;
const Portfolio = () => (
    <section id="next-section" className="portfolio-area section-py">
        <div className="container">
            <div className="row">
                <div className="col-12 text-center">
                    <div className="section-heading mb-70">
                        <h2 className="pb-5">Latest Works</h2>
                        <p>The point of using Lorem Ipsum is that it has a more-or-less normal distribution <br className="d-none d-md-block"/> of letters, as opposed to using 'Content here, content</p>
                    </div>
                </div>
            </div>
            <div className="row">
                <div className="col-12 col-lg-10 mx-auto">
                    <div className="portfolio-item style4">

                        {pitem}
                    
                    </div>
                </div>
            </div>
        </div>
    </section>
);

export default Portfolio;
